// Solution 2:
const moveAtoEnd = (arr) => {
    for (let i = 0; i < arr.length; i++) {
        if (arr[i]!== "a" && arr[i + 1] === "a") {
            [arr[i], arr[i + 1]] = [arr[i + 1], arr[i]];
        }
    }
};
